\textbf{Eleventy-ninth Problem Competition in Penquintland}
The Problem Committee of the Eleventy-ninth Problem Competition in Penquintland would like to give away the Pale Awards (also known as prizemoney) to the winners. The prize money is a convex hexahedron whose faces have only integer areas, sides have integer lengths, and all interior angles are right angles. Use as few Pythagorean triples as possible to find the dimensions of the hexahedron and calculate the total prize money owed.

What is the minimum number of Pythagorean triples that are strictly sufficient for the construction of a prize hexahedron?
